// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Marketplace {
    // Order statuses supported in this Marketplace
    enum OrderStatus { Pending, Paid, Confirmed, Shipped, Delivered, Cancelled }

    // Product structure includes name field and seller information
    struct Product {
        uint256 id;
        string name;
        uint256 price;
        address seller;
        bool isAvailable;
    }

    // Order structure for tracking orders with deadlines
    struct Order {
        uint256 id;
        address buyer;
        uint256 productId;
        uint256 timestamp;
        uint256 deadline;
        OrderStatus status;
    }

    Product[] public products;
    mapping(uint256 => Product) public productById;
    mapping(uint256 => Order) public orders;
    mapping(uint256 => uint256) private orderPayments;
    uint256 private orderNonce;

    // Events for off-chain notification
    event ProductAdded(uint256 indexed productId, address indexed seller, uint256 price, string name);
    event ProductUpdated(uint256 indexed productId, string newName, uint256 newPrice);
    event OrderCreated(uint256 indexed orderId, address indexed buyer, uint256 indexed productId, uint256 amount);
    event OrderStatusUpdated(uint256 indexed orderId, OrderStatus newStatus);

    // Adds a new product to the marketplace
    function addProduct(string memory name, uint256 price) external {
        uint256 productId = products.length;
        Product memory newProduct = Product({
            id: productId,
            name: name,
            price: price,
            seller: msg.sender,
            isAvailable: true
        });
        products.push(newProduct);
        productById[productId] = newProduct;
        emit ProductAdded(productId, msg.sender, price, name);
    }

    // Updates product information such as name and price
    function updateProductName(uint256 productId, string memory newName, uint256 newPrice) external {
        Product storage product = productById[productId];
        require(msg.sender == product.seller, "Only seller can update product");
        product.name = newName;
        product.price = newPrice;
        // Maintain consistency with the products array
        products[productId] = product;
        emit ProductUpdated(productId, newName, newPrice);
    }

    // Buyer-facing function to create an order, now with explicit price input.
    // The buyer must supply the productId and the expected price (priceInput) exactly matching the product's price,
    // and send exactly that amount in msg.value.
    function createOrder(uint256 productId, uint256 priceInput) public payable {
        Product storage product = productById[productId];
        require(product.isAvailable, "Product not available");
        require(priceInput == product.price, "Price input mismatch");
        require(msg.value == priceInput, "Incorrect payment amount");
        
        // Generate a unique order id based on sender, product, nonce and timestamp
        uint256 orderId = uint256(keccak256(abi.encodePacked(msg.sender, productId, orderNonce, block.timestamp)));
        orderNonce++;
        
        Order memory newOrder = Order({
            id: orderId,
            buyer: msg.sender,
            productId: productId,
            timestamp: block.timestamp,
            deadline: block.timestamp + 1 hours,
            status: OrderStatus.Paid
        });
        orders[orderId] = newOrder;
        orderPayments[orderId] = msg.value;
        
        // Mark the product as unavailable
        product.isAvailable = false;
        products[productId] = product;
        
        emit OrderCreated(orderId, msg.sender, productId, msg.value);
    }

    // Updates the order status respecting proper transitions and deadlines
    function updateOrderStatus(uint256 orderId, OrderStatus newStatus) external {
        Order storage order = orders[orderId];
        Product storage product = productById[order.productId];
        
        // Only buyer or seller may update the order
        require(msg.sender == order.buyer || msg.sender == product.seller, "Unauthorized");
        require(block.timestamp <= order.deadline, "Order has expired");
        require(isValidTransition(order.status, newStatus), "Invalid status transition");
        
        // If the order is cancelled, refund the buyer and mark product as available again
        if (newStatus == OrderStatus.Cancelled) {
            product.isAvailable = true;
            products[order.productId] = product;
            payable(order.buyer).transfer(orderPayments[orderId]);
        }
        
        order.status = newStatus;
        emit OrderStatusUpdated(orderId, newStatus);
    }

    // Validates whether the transition from the current status to a new status is allowed
    function isValidTransition(OrderStatus from, OrderStatus to) public pure returns (bool) {
        if (from == OrderStatus.Paid) {
            return (to == OrderStatus.Confirmed || to == OrderStatus.Cancelled);
        } else if (from == OrderStatus.Confirmed) {
            return (to == OrderStatus.Shipped);
        } else if (from == OrderStatus.Shipped) {
            return (to == OrderStatus.Delivered);
        }
        return false;
    }

    // Utility function to view product price, aiding buyers to know the exact pay required
    function getProductPrice(uint256 productId) external view returns (uint256) {
        return productById[productId].price;
    }
}

